processors = [1 2 4 8 16];k10_runtimes = [46.44 25.03 13.64 8.67 7.54];k20_runtimes = [103.81 49.28 26.32 14.82 10.18];k40_runtimes = [205.89 102.86 50.72 27.87 15.84];k80_runtimes = [468.88 208.40 103.61 51.86 27.80];k160_runtimes = [965.79, 475.97, 219.94, 104.26, 53.09];k10_speedup = (repmat(k10_runtimes(1), 1, 5) ./ k10_runtimes);k10_efficiency = k10_speedup ./ processors;k20_speedup = (repmat(k20_runtimes(1), 1, 5) ./ k20_runtimes);k20_efficiency = k20_speedup ./ processors;k40_speedup = (repmat(k40_runtimes(1), 1, 5) ./ k40_runtimes);k40_efficiency = k40_speedup ./ processors;k80_speedup = (repmat(k80_runtimes(1), 1, 5) ./ k80_runtimes);k80_efficiency = k80_speedup ./ processors;k160_speedup = (repmat(k160_runtimes(1), 1, 5) ./ k160_runtimes);k160_efficiency = k160_speedup ./ processors;f = figure;hold on;title('Efficiency');xlabel('Processors in Cluster');ylabel('Efficiency');plot(processors, k10_efficiency, 'Color', 'b', 'LineWidth', 3);plot(processors, k20_efficiency, 'Color', 'y', 'LineWidth', 3);plot(processors, k40_efficiency, 'Color', 'g', 'LineWidth', 3);plot(processors, k80_efficiency, 'Color', 'c', 'LineWidth', 3);plot(processors, k160_efficiency, 'Color', 'm', 'LineWidth', 3);plot(processors, repmat([1], 1, 5), 'Color', 'r', 'LineWidth', 1);legend('10k Training Images', '20k Training Images',       '40k Training Images', '80k Training Images',       '160k Training Images', '1:1 Speedup');saveas(f, 'efficiency.png');g = figure;hold on;axis equal;title('Speedup');xlabel('Processors in Cluster');ylabel('Speedup');plot(processors, k10_speedup, 'Color', 'b', 'LineWidth', 3);plot(processors, k20_speedup, 'Color', 'y', 'LineWidth', 3);plot(processors, k40_speedup, 'Color', 'g', 'LineWidth', 3);plot(processors, k80_speedup, 'Color', 'c', 'LineWidth', 3);plot(processors, k160_speedup, 'Color', 'm', 'LineWidth', 3);plot(processors, processors, 'Color', 'r', 'LineWidth', 1);legend('10k Training Images', '20k Training Images',       '40k Training Images', '80k Training Images',       '160k Training Images', '1:1 Speedup');saveas(g, 'speedup.png');